// Card.js
import React from 'react';
import '../postCard/postdata'
const Card = ({ username, date, text }) => {
  return (
    <div className="card">
      <div className="card-content">
        <p><strong>Username:</strong> {username}</p>
        <p><strong>Date:</strong> {date}</p>
        <p><strong>Text:</strong> {text}</p>
      </div>
    </div>
  );
};

export default Card;
